/********
Functions
*********/
PS.component.portrait.func = {};

/*****
ACTION
******/
PS.component.portrait.func.action_redrawPortrait = ()=>{
    let face = document.querySelector("svg #face");
    if(face !== undefined || face !== null){
        let coords = [event.x, event.y];
        if(PS.func.test_isWithin(coords, face) === true){
            // category selected
            if(PS.component.category.state.selected[0] === true){
                PS.component.portrait.func.remove_portraitSVG();
                PS.component.portrait.func.init_toCategory();

            }
            else{ // home
                PS.component.portrait.func.remove_portraitSVG();
                PS.component.portrait.func.init_landHome();
            };
        };
    };
};


/***
INIT
****/
PS.component.portrait.func.init_component = async()=>{
    let urlStateObj = await PS.func.get_urlStateObj();
    // if land home
    if(urlStateObj.category === undefined
    && urlStateObj.link     === undefined){
        PS.component.portrait.func.init_landHome();
        // PS.component.portrait.func.start_randomColorPieces();
    }
    // if land category
    else
    if(urlStateObj.category !== undefined
    && urlStateObj.link     === undefined){
        PS.component.portrait.func.init_landCategory(urlStateObj);
    };
};


PS.component.portrait.func.init_toCategory = async ()=>{
    PS.component.portrait.func.serve_SVG();
    await PS.component.portrait.func.set_elementPieces();
    let color = PS.component.category.state.selected[1].setting.color;
    PS.component.portrait.func.transition_drawWithColor(color);
};


PS.component.portrait.func.init_landCategory = async(urlStateObj)=>{
    PS.component.portrait.func.serve_SVG();
    await PS.component.portrait.func.set_elementPieces();
    let categoryName = urlStateObj.category;
    let color;
    for(obj of PS.component.category.objs){
        let name = obj.setting.name;
        if(name === categoryName){
            color = obj.setting.color;
            PS.component.portrait.func.transition_drawWithColor(color);
            break;
        };
    };
};


PS.component.portrait.func.init_landHome = async()=>{
    PS.component.portrait.func.serve_SVG(); // appends SVG
    await PS.component.portrait.func.set_elementPieces(); // collects SVG pieces into a setting array
    let localStorageObj = JSON.parse(window.localStorage.getItem("PS"));
    let colorMode       = localStorageObj.colorMode;
    if( colorMode === "light"){
        PS.component.portrait.func.transition_drawWithColor("blackBlue_1");
    }
    else
    if( colorMode === "dark"){
        PS.component.portrait.func.transition_drawWithColor("white_1");
    };
};


/*****
REMOVE
******/
PS.component.portrait.func.remove_portraitSVG = ()=>{
    let portraitSpace = document.getElementById("portraitSpace_PS");
        portraitSpace.classList.remove("portrait_fadeOut");
    let svgNode = portraitSpace.children[0].children[0];
    if( svgNode !== undefined){
        svgNode.remove();
    };
};


/****
SERVE
*****/
PS.component.portrait.func.serve_SVG = ()=>{
    let portraitWrap = document.querySelector("#portraitSpace_PS > div");
    portraitWrap.insertAdjacentHTML("afterbegin", PS.component.portrait.setting.svg);
};


/**
SET
***/
PS.component.portrait.func.set_elementPieces = ()=>{
    return new Promise((resolve, reject)=>{
        do{
            PS.component.portrait.setting.elementPieces_strokeOnly = [
                document.querySelector("#face #topRight"),
                document.querySelector("#face #bottomRight"),
                document.querySelector("#face #bottom"),
                document.querySelector("#face #mainLight"),
                document.querySelector("#face #leftCheekLine"),
                document.querySelector("#leftEye #lid"),
                document.querySelector("#leftEye #bottomLine"),
                document.querySelector("#leftEye #brow"),
                document.querySelector("#leftEye #outerSurrounding"),
                document.querySelector("#rightEye #lid"),
                document.querySelector("#rightEye #bottomLine"),
                document.querySelector("#rightEye #brow"),
                document.querySelector("#ear #outerRimLine"),
                document.querySelector("#ear #innerDish"),
                document.querySelector("#ear #bulk"),
                document.querySelector("#nose #upperRightShadow"),
                document.querySelector("#nose #bottom"),
                document.querySelector("#nose #underDark"),
                document.querySelector("#mouth #rightDark"),
                document.querySelector("#mouth #upperDark"),
                document.querySelector("#mouth #underDivet"),
                document.querySelector("#mouth #underDivetLeft"),
                document.querySelector("#mouth #upperLipNoseDivet"),
                document.querySelector("#neck #leftLight "),
                document.querySelector("#neck #mainContours "),
                document.querySelector("#neck #upperAdams"),
                document.querySelector("#neck #lowerAdams"),
                document.querySelector("#neck #rightLine"),
                document.querySelector("#shirt #right"),
                document.querySelector("#shirt #left")
            ];

            PS.component.portrait.setting.elementPieces_strokeAndFill = [
                document.querySelector("#face #bottomShadow"),
                document.querySelector("#leftEye #leftEyeGroup"),
                document.querySelector("#rightEye #rightEyeGroup"),
                document.querySelector("#ear #bottomRightDarkSpot"),
                document.querySelector("#ear #bottomLeftDarkSpot"),
                document.querySelector("#ear #topRightDarkSpot"),
                document.querySelector("#ear #topLeftDarkSpot"),
                document.querySelector("#nose #rightShadow"),
                document.querySelector("#nose #leftNostril"),
                document.querySelector("#nose #rightNostril"),
                document.querySelector("#mouth #darkLipLine"),
                document.querySelector("#hair")
            ];

            resolve();
        }
        while(PS.component.portrait.setting.elementPieces_strokeOnly.length === 0
            ||PS.component.portrait.setting.elementPieces_strokeAndFill.length === 0);
    });
};


/****
START
*****/
PS.component.portrait.func.start_randomColorPieces = ()=>{
    let delay = setTimeout(()=>{
        let colors = [];
        for(i in PS.component.category.objs){
            let categoryObj = PS.component.category.objs[i];
            colors.push(categoryObj.setting.color);
        };
        PS.component.portrait.setting.interval.randomColorPieces = setInterval(()=>{
            let rand_piece = PS.component.portrait.setting.elementPieces_strokeOnly[Math.floor(Math.random() * PS.component.portrait.setting.elementPieces_strokeOnly.length)];
            let rand_color = colors[Math.floor(Math.random() * colors.length)];
            rand_piece.classList = "";
            rand_piece.classList.add("stroke");
            rand_piece.classList.add(`${rand_color}`);
        },10);
    },4000);
};


/*********
TRANSITION
**********/
PS.component.portrait.func.transition_colorFade = (color)=>{
    let allColors = ["blackBlue_1", "white_1"]; // start with these inserted, as category objs don't have these colors
    for(obj of PS.component.category.objs){ // add colors chosen for categories
        allColors.push(obj.setting.color);
    };
    for(i in PS.component.portrait.setting.elementPieces_strokeOnly){
        let strokeOnlyPiece = PS.component.portrait.setting.elementPieces_strokeOnly[i];
        for(i in allColors){
            let removeColor = allColors[i];
            strokeOnlyPiece.classList.remove(`${removeColor}`);
            if(Number(i) === allColors.length - 1){
                strokeOnlyPiece.classList.add(`${color}`);
            };
        };
    };
    for(i in PS.component.portrait.setting.elementPieces_strokeAndFill){
        let strokeAndFillPiece = PS.component.portrait.setting.elementPieces_strokeAndFill[i];
            strokeAndFillPiece.classList.add(`${color}`);
        for(i in allColors){
            let removeColor = allColors[i];
            strokeAndFillPiece.classList.remove(`${removeColor}`);
            if(Number(i) === allColors.length - 1){
                strokeAndFillPiece.classList.add(`${color}`);
            };
        };
    };
};


PS.component.portrait.func.transition_drawWithColor = (color)=>{
    for(i in PS.component.portrait.setting.elementPieces_strokeOnly){
        let strokeOnlyPiece = PS.component.portrait.setting.elementPieces_strokeOnly[i];
            strokeOnlyPiece.classList.add(color);
            strokeOnlyPiece.classList.add("draw");

        let delay_afterDraw = setTimeout(()=>{
            strokeOnlyPiece.classList.add('stroke');
            strokeOnlyPiece.classList.remove('draw');
        },2000);

    };
    for(i in PS.component.portrait.setting.elementPieces_strokeAndFill){
        let strokeAndFillPiece = PS.component.portrait.setting.elementPieces_strokeAndFill[i];
            strokeAndFillPiece.classList.add(color);
            strokeAndFillPiece.classList.add("draw");

        let delay_shorter = setTimeout(()=>{
            strokeAndFillPiece.classList.add('fill');
        },800);

        let delay_afterDraw_2 = setTimeout(()=>{
            strokeAndFillPiece.classList.add('stroke');
            strokeAndFillPiece.classList.remove('draw');
        },2000);
    };
};


PS.component.portrait.func.transition_fadeOut = ()=>{
    let portraitSpace = document.getElementById("portraitSpace_PS");
        portraitSpace.classList.add("portrait_fadeOut");
};



